import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

const routes: Routes = [
  { path: '', redirectTo: '/home', pathMatch: 'full', component }, // Redirect to home page
  { path: 'home', loadChildren: () => import('./app.module').then(m => m.AppModule) }, // Lazy load the AppModule
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
